import React from 'react'
import './App.css'
const FilterComp = () => {
  return (
    <div className='FilterContainer'>
      <button> All</button>
      <button> Breakfast</button>
      <button> Lunch</button>
      <button> Dinner</button>
    </div>
  )
}

export default FilterComp
